import React from "react"
import Link from "next/link"

import "./layout.css"

const Link_ = (props) => {
    return (
        <Link styles={{
                color: 'grey',
                background: 'orange'
            }}
            href={props.href}
        >
            {props.children}
        </Link>
    );
}

class Layout extends React.Component {
    state = { };

    render() {
        return (
            <main>
                <nav>
                    <ul>
                        <Link_ style={{color: 'red'}} href="/">
                            <a>Home</a>
                        </Link_>
                        <Link_ href="/about">
                            <a>About</a>
                        </Link_>
                    </ul>
                </nav>
                {this.props.children}
            </main>
        );
    }
}

export default Layout;
